import React, { useState, useEffect } from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';
import { Chart as ChartJS, CategoryScale, LinearScale, BarElement, ArcElement, Title, Tooltip, Legend, PointElement, LineElement } from 'chart.js';
import { Bar, Doughnut, Line } from 'react-chartjs-2';

ChartJS.register(CategoryScale, LinearScale, BarElement, ArcElement, Title, Tooltip, Legend, PointElement, LineElement);

const DashboardContainer = styled.div`
  padding: 40px;
  background: linear-gradient(135deg, #f8fafc 0%, #e2e8f0 100%);
`;

const SectionTitle = styled.h2`
  font-family: 'Merriweather', serif;
  font-size: 2.2rem;
  color: #1e3a8a;
  margin-bottom: 15px;
  text-align: center;
`;

const SectionSubtitle = styled.p`
  font-size: 1.1rem;
  color: #64748b;
  text-align: center;
  margin-bottom: 40px;
  line-height: 1.6;
`;

const KeyMetricsGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(280px, 1fr));
  gap: 30px;
  margin-bottom: 50px;
`;

const MetricCard = styled(motion.div)`
  background: white;
  border-radius: 20px;
  padding: 35px;
  box-shadow: 0 10px 30px rgba(0,0,0,0.1);
  text-align: center;
  position: relative;
  overflow: hidden;
  border: 1px solid #e2e8f0;

  &:hover {
    transform: translateY(-5px);
    box-shadow: 0 20px 40px rgba(0,0,0,0.15);
  }

  &::before {
    content: '';
    position: absolute;
    top: 0;
    left: 0;
    right: 0;
    height: 4px;
    background: ${props => {
      switch(props.type) {
        case 'stable': return 'linear-gradient(90deg, #fbbf24, #f59e0b)';
        case 'increase': return 'linear-gradient(90deg, #10b981, #059669)';
        case 'decrease': return 'linear-gradient(90deg, #ef4444, #dc2626)';
        default: return 'linear-gradient(90deg, #3b82f6, #1e40af)';
      }
    }};
  }
`;

const MetricIcon = styled.div`
  font-size: 3rem;
  margin-bottom: 15px;
  opacity: 0.8;
`;

const MetricNumber = styled.div`
  font-size: 3.5rem;
  font-weight: 700;
  color: ${props => {
    switch(props.type) {
      case 'stable': return '#f59e0b';
      case 'increase': return '#059669';
      case 'decrease': return '#dc2626';
      default: return '#1e40af';
    }
  }};
  margin-bottom: 10px;
  text-shadow: 2px 2px 4px rgba(0,0,0,0.1);
`;

const MetricLabel = styled.div`
  font-size: 1.1rem;
  font-weight: 600;
  color: #374151;
  margin-bottom: 8px;
`;

const MetricDescription = styled.div`
  font-size: 0.9rem;
  color: #6b7280;
  line-height: 1.4;
`;

const ChartsGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(500px, 1fr));
  gap: 40px;
  margin: 50px 0;
`;

const ChartContainer = styled(motion.div)`
  background: white;
  border-radius: 20px;
  padding: 35px;
  box-shadow: 0 10px 30px rgba(0,0,0,0.1);
  border: 1px solid #e2e8f0;
`;

const ChartTitle = styled.h3`
  font-family: 'Merriweather', serif;
  font-size: 1.4rem;
  color: #1e3a8a;
  margin-bottom: 25px;
  text-align: center;
`;

const KeyInsightsSection = styled.div`
  background: white;
  border-radius: 20px;
  padding: 40px;
  margin: 40px 0;
  box-shadow: 0 10px 30px rgba(0,0,0,0.1);
`;

const InsightsList = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(350px, 1fr));
  gap: 25px;
  margin-top: 30px;
`;

const InsightCard = styled(motion.div)`
  background: ${props => {
    switch(props.type) {
      case 'warning': return 'linear-gradient(135deg, #fef3c7, #fde68a)';
      case 'success': return 'linear-gradient(135deg, #d1fae5, #a7f3d0)';
      case 'info': return 'linear-gradient(135deg, #dbeafe, #bfdbfe)';
      default: return 'linear-gradient(135deg, #f3f4f6, #e5e7eb)';
    }
  }};
  padding: 25px;
  border-radius: 15px;
  border-left: 4px solid ${props => {
    switch(props.type) {
      case 'warning': return '#f59e0b';
      case 'success': return '#10b981';
      case 'info': return '#3b82f6';
      default: return '#6b7280';
    }
  }};
`;

const InsightTitle = styled.h4`
  font-size: 1.1rem;
  font-weight: 600;
  color: #1f2937;
  margin-bottom: 10px;
`;

const InsightText = styled.p`
  font-size: 0.95rem;
  color: #374151;
  line-height: 1.5;
`;

const ExecutiveDashboard = () => {
  const [animateCounters, setAnimateCounters] = useState(false);

  useEffect(() => {
    setTimeout(() => setAnimateCounters(true), 500);
  }, []);

  const keyMetrics = [
    {
      icon: 'ðŸ“Š',
      number: '60%',
      label: 'Stable Participation',
      description: 'Clinicians maintained consistent Medicaid enrollee volumes throughout the study period',
      type: 'stable'
    },
    {
      icon: 'ðŸ“ˆ',
      number: '20%',
      label: 'Major Increases',
      description: 'Experienced substantial growth in Medicaid patient loads (>90% increase)',
      type: 'increase'
    },
    {
      icon: 'ðŸ“‰',
      number: '20%',
      label: 'Major Decreases',
      description: 'Significant reduction in Medicaid participation (>90% decrease)',
      type: 'decrease'
    },
    {
      icon: 'ðŸ¥',
      number: '220,665',
      label: 'Total Clinicians',
      description: 'Primary care providers analyzed across 40 states over 4 years',
      type: 'default'
    }
  ];

  const participationData = {
    labels: ['Stable (60%)', 'Major Increase (20%)', 'Major Decrease (20%)'],
    datasets: [{
      data: [60, 20, 20],
      backgroundColor: ['#f59e0b', '#10b981', '#ef4444'],
      borderWidth: 0,
      hoverOffset: 10
    }]
  };

  const specialtyData = {
    labels: ['Nurse Practitioners', 'Family Medicine', 'Internal Medicine', 'OB/GYN', 'Pediatrics', 'Physician Associates'],
    datasets: [
      {
        label: 'Major Increases (%)',
        data: [22, 14, 17, 16, 14, 24],
        backgroundColor: '#10b981',
        borderRadius: 8
      },
      {
        label: 'Major Decreases (%)',
        data: [26, 20, 19, 16, 16, 24],
        backgroundColor: '#ef4444',
        borderRadius: 8
      },
      {
        label: 'Stable (%)',
        data: [52, 66, 64, 68, 70, 52],
        backgroundColor: '#f59e0b',
        borderRadius: 8
      }
    ]
  };

